import React, { useState } from 'react';
/*import './assets/ModalRegistroExitoso.css'
const SuccessMessage = ({ message }) => {
  return (
  <div className='modal-container'>
    <div className='modal-content' green-background >
     
      <div className='message'>{message}</div>
      
      <div className='btn-ok'>
        <button onClick={() => window.history.back()}>OK</button>
      </div>
    </div>
  </div>
  );
};
//export default SuccessMessage;
*/




const RegistroForm = () => {
  const [registroExitoso, setRegistroExitoso] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    
    // Lógica de registro exitoso (puede ser una llamada a una API, etc.)
    
    // Después de un registro exitoso, muestra el mensaje
    setRegistroExitoso(true);
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        

        <button type="submit">Registrar</button>
      </form>

      {registroExitoso && <SuccessMessage message="¡Registro exitoso!" />}
    </div>
  );
};

export default RegistroForm;
